import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var Slash = createReactComponent("Slash", ["svg", defaultAttributes, [["circle", {
  cx: "12",
  cy: "12",
  r: "10",
  key: "14id60"
}], ["line", {
  x1: "4.93",
  y1: "4.93",
  x2: "19.07",
  y2: "19.07",
  key: "m6hk5s"
}]]]);
export default Slash;
